import React from "react";
import "./styles.scss";
import CustomNav from "./navbar-components/navbar.js";
import { Route, Routes } from "react-router-dom"
import Home from "./pages/home.js"

function App() {
  return (
    <>
      <CustomNav />
      <div className="container">
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </>
  )
}

export default App
